import React, {useState, useEffect} from 'react';
import axios from 'axios';

export default function Memberlist() {
    const [user, setuser] = useState([]);
    useEffect(() => {
        axios.get("http://localhost:5000/users/")
        .then(response=>{
            setuser(response.data);
        })
        .catch(error=>
            {console.log(error)
            });
    })
    return (
        <div>
            <h1>Member List</h1>

                        <table>
                            <thead>
                                <tr>
                                <th>First Name</th>
                                <th>Last Name</th>
                                <th>Email</th>
                                <th>Contact</th>
                                </tr>
                            </thead>

{(user.map(users=>{
    return (
        <tbody key={users._id}>
        <tr>
            <td>{(users.firstname) }</td>
            <td>{(users.lastname) }</td>
            <td>{(users.email) }</td>
            <td>{(users.contact) }</td>
        </tr>
        </tbody>
        )})
      )}

                        </table>

                    </div>
                )

}
